	add("stein", "{\"term\":\"stein\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\"], \"text\":\"From a regional use\u0026lt;ref\u0026gt;{{R:Duden|Stein}}\u0026lt;/ref\u0026gt; of German \u0027stein\u0027 (stone) Probably a corruption of Steingut (\u0026quot;stoneware\u0026quot;) or Steinkrug. Compare Old english (ca. 450-1100) {{m|ang|st«£na||stone jug, a pot of stone or earth}}. More at {{l|en|stean}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A beer mug, usually made of ceramic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"So this was my future home, I thought! Certainly it made a brave picture. I had seen similar ones fired-in on many a Heidelberg \u0027\u0027stein\u0027\u0027. Backed by towering hills,a sky of palest Gobelin flecked with fat, fleecy little clouds, it in truth looked a dear little city; the city of one\u0027s dreams\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A gnome-size German civilian with a red von Hindenburg mustache is dispensing \u0027\u0027steins\u0027\u0027 of what looks to be mostly head\", \"priority\":3}]}, \"synonyms\":{}}");

	add("stela", "{\"term\":\"stela\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin {{m|la|stela|stƒìla}}, from Ancient greek (to 1453) {{m|grc|œÉœÑŒÆŒªŒ∑}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an obelisk or upright stone pillar, usually as a primitive commemoration or graveston\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1776\u0027\u0027, R. Chandler, \u0027Trav. Greece\u0027, VIII\u0026amp;thinsp;3\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the courts of the houses lie many round \u0027\u0027stel√¶\u0027\u0027, or pillars, once placed on the graves of the Athenians\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1837\u0027\u0027, J. G. Wilkinson, \u0027Manners \u0026amp; Customs of the Anc. Egyptians\u0027, I\u0026amp;thinsp;ii\u0026amp;thinsp;10\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He erected a \u0027\u0027stela\u0027\u0027, with an inscription in the sacred character, to commemorate his successes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1876\u0027\u0027, S. Manning, \u0027Land of Pharaohs\u0027, 20\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The upright blocks or \u0027\u0027stelas\u0027\u0027 are among the most curious parts of the present ruin\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1893\u0027\u0027, E. A. T. W. Budge, \u0027Mummy\u0027, 3\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Thothmes I. set up two \u0027\u0027stel√¶\u0027\u0027 near the Euphrates\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1966\u0027\u0027, Paul Bowles, \u0027Up Above the World\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A shore excursion had been arranged for the passengers who were interested in visiting the \u0027\u0027stelae\u0027\u0027 of San Ignacio\", \"priority\":11}]}, \"synonyms\":{}}");

	add("stemline", "{\"term\":\"stemline\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stem|line|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The line connecting individual letters in Ogham\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stemmatics", "{\"term\":\"stemmatics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of multiple surviving versions of the same text with the aim of reconstructing a lost original\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Conor Fahy, \u0026quot;Old and New in Italian Textual Criticism\u0026quot;, page 404 \u0027in\u0027 Raimonda Modiano, Leroy Searle, \u0026amp; Peter L. Shillingsburg (eds.), \u0027Voice, Text, Hypertext: Emerging Practices in Textual Studies\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In other words, they must carry out an operation similar to the collations required by Lachmannian \u0027\u0027stemmatics\u0027\u0027, after which they must make a critical (i.e., subjective) choice. And, when constituting the text, they do not just slavishly copy their source, obvious errors included; their editions always contain an element of interpretation\", \"priority\":3}]}, \"synonyms\":{}}");

