	add("stemming", "{\"term\":\"stemming\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|stemmen|ing|lang\u003dnl}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Movement against a current, especially a tidal current\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A process for removing the inflexional, and sometimes derivational, affixes from words\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The technique of bridging between two holds with hands and/or feet, applying forces to each in opposing directions in order to brace oneself in position\", \"priority\":3}]}, \"synonyms\":{}}");

