	add("stench", "{\"term\":\"stench\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|stench}}, from Old english (ca. 450-1100) {{m|ang|stenƒã||stench, odor, fragrance}}, from Proto-germanic {{m|gem-pro|*stankwiz||smell, fragrance, odor}}, from Proto-indo-european {{m|ine-pro|*(s)tewg-||to push, hit}}. Cognate with Dutch {{m|nl|stank||stench, odor}}, German {{m|de|Stank}}, {{m|de|Gestank||stench, odor, smell}}, Danish {{m|da|stank||stench}}, Swedish {{m|sv|stank||stench}}, Icelandic {{m|is|st√¶kja||stench}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a strong foul smell, a stin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a foul qualit\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027stench\u0027\u0027 of political corruption\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A smell or odour, not necessarily bad\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Clouds of savoury \u0027\u0027stench\u0027\u0027 involve the sky\", \"priority\":6}]}, \"synonyms\":{}}");

