	add("stenophagy", "{\"term\":\"stenophagy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"eating just a few types of food, generally all of similar types, such as eating only some kinds of termites, or some kinds of lily bulbs, or some kinds of Eucalyptus leaves\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The often-found \u0027\u0027stenophagy\u0027\u0027 in local populations of euryphagous species may indicate the emergence of stenophagous forms from euryphagous ones\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, Smith, John Maynard (ed) Jermy, T., Labos, E., Molnar, I. , \u0027Organizational Constraints on the Dynamics of Evolution\u0027, Manchester University Press, pages 157-16\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"there is sound circumstantial evidence ... that the predominance of \u0027\u0027stenophagy\u0027\u0027 is due to the insects\u0027 restricted ability to recognize ... plant species\", \"priority\":4}]}, \"synonyms\":{}}");

