	add("stepchild", "{\"term\":\"stepchild\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) from Old english (ca. 450-1100) {{m|ang|stƒìopƒãild}}, equivalent to {{prefix|step|child|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A stepson or stepdaughte\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The family \u0027role\u0027 (responsibilities and behavioural standards) of a stepchild\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A bereaved child; one who has lost father or mother.\u0026lt;!--Webster 1913--\u0026gt\", \"priority\":3}]}, \"synonyms\":{}}");

