	add("stephen", "{\"term\":\"stephen\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin {{m|la|Stephanus}}, from Ancient greek (to 1453) \u0027œÉœÑŒ≠œÜŒ±ŒΩŒøœÇ\u0027 from \u0027œÉœÑŒ≠œÜŒ±ŒΩŒøœÇ\u0027 (crown, wreath) from \u0027œÉœÑŒ≠œÜœâ\u0027 (to put round, to surround)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The first Christian martyr\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"And \u0027\u0027Stephen\u0027\u0027, full of faith and power, did great wonders and miracles among the people\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1852\u0027\u0027 , \u0027Tale of a Carpet-Bag\u0027, Ainsworth\u0027s Magazine, Vol. 21, page 17\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I, for my part, ask any candid reader if it was not bad enough to be called Broadfoot, without having it aggravated into \u0027\u0027\u0027Stephen\u0027\u0027\u0027 Broadfoot? I feel confident I will here get a tear of sympathy from all unhappy Andrews and Peters, and Aarons and Samuels, with a smile of disdainful compassion from thrice-happy Franks and Charleys and Bills\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1952\u0027\u0027 Thomas Pyles, \u0027Words and Ways of American English\u0027, Random House, page 245\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"It is doubtless true that American English lacks a tradition for the pronunciation of \u0027Anthony\u0027, a name which was not often bestowed upon American males until the comparatively recent craze for supposedly swank \u0026quot;British\u0026quot; Christian names, like \u0027\u0027\u0027Stephen\u0027\u0027\u0027, \u0027Peter\u0027, \u0027Michael\u0027, etc., in this country\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027 , \u0027The Last Samurai\u0027, Miramax Books(2002), ISBN 0786887001, page 142\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I thought that ideally it should be a name which could work whether he was serious and reserved or butch, a name like \u0027\u0027Stephen\u0027\u0027 which could be Steve or David which could be Dave\", \"priority\":8}]}, \"synonyms\":{}}");

