	add("steven", "{\"term\":\"steven\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin {{m|la|Stephanus}}, from Ancient greek (to 1453) \u0027œÉœÑŒ≠œÜŒ±ŒΩŒøœÇ\u0027 from \u0027œÉœÑŒ≠œÜŒ±ŒΩŒøœÇ\u0027 (crown, wreath) from \u0027œÉœÑŒ≠œÜœâ\u0027 (to put round, to surround)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a variant spelling of Stephen\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027 Ann Beattie: \u0027Picturing Will\u0027. Random House. ISBN 0394569873 page 67\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His first name was probably Steve or Ed. No, there were no more Steves or Eds in New York. They were now \u0027\u0027Steven\u0027\u0027 or Edward, whether they were gay or straight. If they had money, they didn\u0027t have a nickname. Everybody was into high seriousness, so that now even dogs were named Humphrey and Raphael\", \"priority\":3}]}, \"synonyms\":{}}");

