	add("steward", "{\"term\":\"steward\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"Icelandic\"], \"text\":\"From Middle english (1100-1500) {{m|enm|steward}}, from Old english (ca. 450-1100) {{m|ang|stƒ´weard}}, {{m|ang|stƒ´ƒ°weard||steward, housekeeper, one who has the superintendence of household affairs, guardian}}, from {{m|ang|stƒ´ƒ°}} in the sense \u0027house\u0027, \u0027hall\u0027 + \u0027weard\u0027 (ward, guard, guardian, keeper) \u0026lt;ref\u0026gt;[http://education.yahoo.com/reference/dictionary/entry/steward American Heritage Dictionary]\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;[http://oxforddictionaries.com/definition/steward Oxford Online Dictionary]\u0026lt;/ref\u0026gt; Compare Icelandic \u0027st√≠var√∞ur\u0027 (steward) More at {{l|en|sty}}, {{l|en|ward}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who manages the property or affairs for another entity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A ship\u0027s officer who is in charge of making dining arrangements and provisions\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There is an hour or two, after the passengers have embarked, which is disquieting and fussy. Mail bags, so I understand, are being put on board. \u0027\u0027Stewards\u0027\u0027, carrying cabin trunks, swarm in the corridors. Passengers wander restlessly about or hurry, with futile energy, from place to place\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A flight attendant, \u0027especially but not exclusively\u0027 a male flight attendant. \u0027Often as\u0027 \u0026quot;air steward\u0026quot;, \u0026quot;airline steward\u0026quot;, etc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A union member who is selected as a representative for fellow workers in negotiating terms with management\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A person who has charge of buildings and/or grounds and/or animals\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A fiscal agent of certain bodies\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In some colleges, an officer who provides food for the students and superintends the kitchen; also, an officer who attends to the accounts of the students\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"In Scotland, a magistrate appointed by the crown to exercise jurisdiction over royal lands\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In information technology, somebody who is responsible for managing a set of projects, products or technologies and how they affect the IT organization to which they belong\", \"priority\":10}]}, \"synonyms\":{}}");

